INSERT INTO `community_board` (`bno`, `moddate`, `regdate`, `content`, `good`, `hits`, `subject`, `title`, `member_id`) VALUES
	(1, '2022-12-30 10:19:02.123584', '2022-12-30 10:19:02.123584', '이사온 지 얼마 안 되서 지리를 잘 모르겠네요ㅠㅠ\r\n혹시 근처에 강아지랑 산책하기 좋은 장소 있나요~~\r\n\r\n사진은 저희 강아지입니당', 0, 2, '애견', '서울 양평역 근처에 강아지랑 산책할만한 장소 있을까요??', 'balloonPM'),
	(2, '2022-12-30 10:52:06.177234', '2022-12-30 10:52:06.177234', '영등포구청으로 최근 발령났는데 아직 이쪽에 친구가 많이 없네요ㅠㅠ\r\n점심시간에 산책하면서 담소 나누실 분 계실분 계실까여\r\n\r\n아 참고로 저는 29살 남자입니다! ', 0, 3, '도보', '영등포 구청역에서 점심시간에 산책하실분~?', 'hong123'),
	(4, '2022-12-30 10:57:58.153189', '2022-12-30 10:57:58.153189', '요즘 인스타에서 광고뜨는 따뜻하귀 이거 진짜 꿀템이네요ㅋㅋ\r\n\r\n그리고 추우면 죽어버리는 아이폰보다는 삼성 갤럭시가 쵝오~', 0, 4, '자전거', '요즘같이 추운날 자전거로 산책할때 꿀템', 'samsungman'),
	(5, '2022-12-30 11:02:20.404738', '2022-12-30 11:02:20.404738', '광교 호수공원 산책하고 간식으로 사먹으려는데 \r\n혹시 근처에 붕어빵 파는 곳 아시는 분 계시면 위치공유 부탁드려요~', 0, 3, '도보', '광교 호수공원 근처에 붕어빵 파는 곳 있나요??', 'applegirl'),
	(6, '2022-12-30 11:08:51.658536', '2022-12-30 11:08:51.658536', '퇴근하고 운동 겸 산책하려는데 혼자하면 심심할거 같기도 하고해서\r\n혹시 동호회도 따로 있을까요??\r\n있으면 가입방법 문의드립니당', 0, 2, '도보', '산책 동호회 같은 것도 있을까요??', 'tis0901'),
	(7, '2022-12-30 11:17:44.304057', '2022-12-30 11:17:44.304057', '산책 동호회 <풍선>에서 신입회원님들을 모십니다~\r\n<풍선>의 뜻은 <풍경을 선물받는 시간>이라는 의미이고\r\n산책하며 좋은 풍경와 좋은 사람들을 많이 보자는 의미입니다.\r\n\r\n주로 모이는 곳은 서울 지역이고 가끔 지방으로도 내려가요\r\n혼자 심심하신 분들, 걷는 걸 좋아하시는 분들\r\n다 환영입니다.\r\n\r\n문의사항은 카카오톡 letsgoballoon 으로 연락주세요. 감사합니다!', 0, 4, '도보', '산책동호회 <풍선>에서 회원모집합니다 !', 'ilovewalking'),
	(8, '2022-12-30 11:23:35.743085', '2022-12-30 11:23:35.743085', '자전거 입문한지 얼마 안 됐는데\r\n동호회 들어가자니 너무 전문적이고..\r\n그냥 친구들이랑 타는 것 처럼 간단하게 즐기고 싶은데\r\n혹시 김포쪽 거주하시는 분 중에 같이 타실 분 계실까\r\n\r\n아 저는 사진찍는 것도 좋아해서 자전거랑 인생샷도 건져드릴 수 있습니다\r\n제 인생샷 하나 첨부해요ㅎ', 0, 2, '자전거', '자린이입니다. 김포쪽에 사시는 분들 중에 자전거 좋아하시는 분', 'iamactor'),
	(9, '2022-12-30 11:36:54.746791', '2022-12-30 11:36:54.746791', '저희 아이 뛰어 놀게 하고 싶은데 한강에 목 줄 풀어놔도 되는 도그파크 있나요?', 0, 2, '애견', '한강 목줄 풀어놔도 되는 도그파크 있나요? ', 'gummy12'),
	(10, '2022-12-30 11:48:10.654311', '2022-12-30 11:47:59.330915', '코딩하다가 머리 복잡해지면 항상 산책하러 나갔다오는데\r\n\r\n산책하고오면 머리가 맑아져서 문제가 바로바로 보이네요ㅋㅋ\r\n\r\n힐링그잡채', 0, 5, '도보', '산책이 확실히 힐링이 되네요', 'springboot'),
	(11, '2022-12-30 14:24:51.497655', '2022-12-30 14:24:51.497655', '3살 수컷 시바견입니다 \r\n\r\n아이들끼리 친구 만드실 견주님 있으면 댓글주세', 0, 3, '애견', '강아지끼리 친구만들어주실 견주님 계시나요~', 'ajajhstar'),
	(12, '2022-12-30 14:35:04.567281', '2022-12-30 14:35:04.567281', '이번 주말에 한강에서 자전거 같이 타실분 있을까요?\r\n\r\n아침에 일찍 타고 같이 점심먹으면 좋을 것 같아요!', 0, 3, '자전거', '이번 주말에 한강에서 자전거타실분', 'aaaaaa'),
	(13, '2022-12-30 14:37:15.420062', '2022-12-30 14:37:15.420062', '제 강쥐데리고 화성갈끈데 \r\n\r\n같이 산책가실 분 계실까요??\r\n\r\n비용은 각자부담입니다.\r\n\r\n출발지는 미국 캘리포니아 호손입니다.', 0, 10, '애견', '화성 산책하러 가실 분', 'dddddd'),
	(14, '2022-12-30 14:47:40.926791', '2022-12-30 14:40:23.991084', '여자친구랑 가려는데 어떤가요?\r\n\r\n거기 여자친구랑 가면 헤어진다는 미신이 있던데...', 0, 6, '도보', '덕수궁 돌담길 어떤가요', 'eeeeee'),
	(15, '2022-12-30 15:16:07.272296', '2022-12-30 15:16:07.272296', '바람쐬러 가고싶은데 마땅히 생각나는 곳이 없네요\r\n거리는 상관없으니 분위기 좋은 곳 어디든 추천부탁드려요!', 0, 4, '도보', '가족들이랑 같이 걸을만한 곳 있나요?', 'bbbbbb');
