INSERT INTO `community_board_reply` (`rno`, `moddate`, `regdate`, `content`, `id`, `nickname`, `community_board_bno`) VALUES
	(1, '2022-12-30 11:01:18.823975', '2022-12-30 11:01:18.823975', '그래도 아이폰이 최고죠 ^^', 'applegirl', '사과는맛있어', 4),
	(2, '2022-12-30 11:11:26.748915', '2022-12-30 11:11:26.748915', '오 가깝네요! 저도 동호회같은 거 찾는 중이었는데 저랑 같이 산책해요~', 'tis0901', 'TIS정보기술교육센터', 2),
	(3, '2022-12-30 11:18:24.672938', '2022-12-30 11:18:24.672938', '네 있습니다. 저희 산책동호회 <풍선>에서 신입회원님들을 모집중이니 많은 관심 부탁드립니다~!', 'ilovewalking', '걷는게제일좋아', 6),
	(4, '2022-12-30 11:40:12.628595', '2022-12-30 11:40:12.628595', '양평역에서 조금만 가시면 강 따라서 산책로 있어요', 'gummy12', '졸음번쩍껌', 1),
	(5, '2022-12-30 14:41:01.392245', '2022-12-30 14:41:01.392245', '오... 비용은 얼마정도 예상되나요?', 'ghkdwogud', '삼겹살좋아요', 13),
	(6, '2022-12-30 14:41:21.875439', '2022-12-30 14:41:21.875439', '여자친구...그게 순향에 도움이 됩니꺼?', 'ghkdwogud', '삼겹살좋아요', 14),
	(8, '2022-12-30 14:44:55.509804', '2022-12-30 14:44:55.509804', '슈븅 or 팥붕 ?', 'kimtaesung1004', '아메리카노', 5),
	(9, '2022-12-30 14:46:29.175280', '2022-12-30 14:46:29.175280', '닉네임이 마음에 드네요. 저와 함께 하시겠습니까?', 'tis0901', 'TIS정보기술교육센터', 10),
	(10, '2022-12-30 14:53:45.630720', '2022-12-30 14:53:45.630720', '많은 참여 부탁드립니다 ^^', 'balloonPM', '풍선왕', 7),
	(12, '2022-12-30 16:14:24.491022', '2022-12-30 16:14:15.486524', '저같은 월급쟁이는... 꿈도 못 꾸겠네요ㅠㅠ', 'doog124', '월급쟁이', 13);
INSERT INTO `free_board` (`bno`, `moddate`, `regdate`, `content`, `good`, `hate`, `hits`, `subject`, `title`, `member_id`) VALUES
	(1, '2022-12-30 15:16:15.777598', '2022-12-30 15:15:02.867569', '이거 손해배상 청구할라고 했는데 개주인분이 너무 죄송해하셔서 선처 해주려고 하는데 그게 좋겠죠?? 그렇게 다치지는 않았어요 ㅠㅠ\r\n\r\n요새 재수가 없는날이 많았는데 기여코 일이 터지네요..ㅜ\r\n\r\n산책을  많이 좋아해서 기분 전환도 할겸 나간건데. 개한테 물리다니 .....', 0, NULL, 0, '', '안녕하세요 저번에 산책하다가 개한테 물렸는데요.. ㅠ', 'kimtaesung1004'),
	(2, '2022-12-30 15:30:52.475472', '2022-12-30 15:30:52.475472', '제가 성산동 쪽에 살고 있는데오 1km만 나가도 한강이보이는 계천가에서 산책할수 있고 강아지들도 많아서 \r\n\r\n강아지 구경도 할겸 나가면 심심할떄 나가면 정말 꿀이랍니다!! ㅎㅎ 아 그리고 출출 할떄는 월드컵 경기장  안에 아이스크림 할인점 들어가서 \r\n\r\n아이스크림 먹으면  그렇게 행복할수가 없어요 ㅋㅋㅋㅋ 다들 시간나실떄 월드컵 계천가 산책 꼭 해보셔용~~^^*&', 0, 0, 0, NULL, '월드컵 산책로가  최고인거같아요~~ 강추!!!', 'ajajhstar'),
	(3, '2022-12-30 16:50:11.159976', '2022-12-30 16:50:11.159976', '아니 제가 산책을 하고 있는데  한겨울에 나시 차림으로 아저씨가 소리를 엄청 지르시면서 지나가는 사람들에게 시비를\r\n\r\n걸고 계시더라구요 저는 무서워서 바로 뒤돌아서 왔던길로 되돌아 집으로 갔습니다. 근데 아저씨 표정이 너무 웃겨서 사진으로 찍어서 올리고\r\n싶은거 꾹참았습니다 아저씨가 뭐라 할까봐서요. 무튼 산책하실떄 다들 조심히 다니셔요 세상에 이상한 사람이 너무 많습니다~~ ~~', 0, 0, 0, NULL, 'ㅋㅋㅋㅋㅋ길가다가 엄청 이상한 사람 봤어요~~ㅋㅋㅋ', 'book1024'),
	(4, '2022-12-30 16:56:17.451448', '2022-12-30 16:56:17.451448', '성북구 주변  산책하기 좋은 산책길 알려주실분 있을실까요??  여친이랑 집거리가 30분 정도 되는데요 가운데가 성북구 부근 이라서요\r\n\r\n혹시  산책길 추천해주실 분들 있으시면 댓글로 부탁좀 드릴께요 저랑 여친이랑 둘다 회사를 다녀서 주말에 만나서 같이 산책하고 배 고파지면 같이\r\n\r\n맛있는거 생각해서 먹는게 저희 커플의  유일한 낙입니당~~ ㅋㅋㅋㅋㅋ   헛소리가 길었네요~ 다들` 좋은 하루 되세요~~~ ', 0, 0, 0, NULL, '저랑 여자친구가 산책을좋아해서요.. 혹시~', 'samsungman'),
	(5, '2022-12-30 17:21:27.333223', '2022-12-30 17:21:27.333223', '오늘은 저희 아빠 생일이어서 다같이 산책하러 나가서 같이 이야기도 하고 걸으며 놀다가\r\n\r\n저희 엄마가 배고프다고 해서 같이 밥먹으러 갔네요~~ ㅎㅎ 이런게 행복인거같아요~~  식사후\r\n\r\n같이 아이스크림 먹은건 안비밀 입니다~~ ㅎㅋㅋㅋ 이번 남은 주말도 행복한 주말되시고 다음에 또 \r\n\r\n글올릴게요`~ 댓글많이 부탁드려요~~ㅎ', 0, 0, 0, NULL, '오늘 가족들이랑 같이 밥먹고 산책하고 너무 재미있게 놀았어요~~', 'springboot'),
	(7, '2022-12-30 17:30:34.001379', '2022-12-30 17:30:34.001379', '다들 머리가 복잡해서 생각이 잘 안날떄는 꼭한번 산책하면서 머리속을 정리해보셈 진짜 리얼로 엄청 생각잘남!!\r\n속는셈치고라도 한번씩 해보는거 진짜 강추 걸으면서 산책하면 진짜 엄청 복잡하던 생각도 정리되는 신기함을 \r\n느낄수 있을꺼임~~~  내친구한테도 추천 해줬는데 1달정도 계속 고민하던  문제가 있었는데 산책 두번 하면서 \r\n문제를 해결했음 정말 속는셈 치고 한번 해봐라 ~~~~~!!!!', 0, 0, 0, NULL, '머리가 복잡할떄는 산책이 진리다!!~~~', 'tis0901'),
	(8, '2022-12-30 17:36:45.449115', '2022-12-30 17:36:45.449115', '제친구가 산책을 무지 좋아하는데요 저도 그친구덕에 산책의 참맛을 알아버려서 같이 산책을 몇번했었거든용~~ 근데\r\n\r\n제친구가 저에게 이 풍선 홈페이지를 가르쳐주더라구요~~  풍경을 선물한다는 뜻이 담겨 있다던데 누가 지었는지 참 잘지었네요` ㅎㅎ\r\n\r\n무튼 제친구랑 이틀에 한번씩은 같이 산책을 해서 자주 여기와서 도움도 받고 재미있는 이야기도 있으면 같이 나누면서 함께 잘지내 보아요~~ ㅎㅎ \r\n\r\n감사합니당~~~^^*', 0, 0, 0, NULL, '안녕하세요 지인의 추천으로  풍선 홈페이지 처음왔어요~!!', 'ilovewalking'),
	(12, '2022-12-30 17:57:15.640290', '2022-12-30 17:57:15.640290', '이번 성산동 산책길 부인이랑 같이 가고 나서 너무 실망해서 글 올립니당~~ 이번에 부인이랑 회사 쉬는\r\n\r\n날이라서 같이 성산동 산책길 가보자고 해서 같이 갔는데  산책길 주변에 소음도 엄청 심해서 부인 말소리도\r\n\r\n잘안들리고  매연도 많더라구여 제가 좋은공기를 마시러 온건지  매연을 마시러 온건지 \r\n\r\n산책길 추천해주실 떄는 그래도 어느정도 좋은곳으로 추천해주셨으면 좋겠어요`~~ 다른사람들은 그말만 믿고  그쪽으로\r\n\r\n산책을 가니까요~ ㅜ', 0, 0, 0, NULL, '저번에 성산동 산책길 추천해 주신분~~', 'iamactor'),
	(14, '2022-12-30 18:18:51.943398', '2022-12-30 18:18:51.943398', '저는 주로  고민이 있을떄는 엄마한테 산책 나가자고 해서 같이 산책하면서 이야기 하면 엄청 좋더라구요~~ 그래서 집주변 산책길\r\n찾을떄마다 항상 풍선 홈페이지 와서 좋은 산책길 많이 알아갑니당~~ ㅎㅎㅎ \r\n감사해요운영자님 제가 이번에 엄마랑 이야기 하면서 저번에 서운한일 이야기 하면서 같이 울면서 행복하자고 다짐했어요~~\r\n풍선 홈페이지 회원분들도 가족분들과 항상 즐거운 하루하루가 되었으면 좋겠어요~~ 뻘글이 길었네요~~ ㅎㅎㅎ 좋은밤되세요~!!!', 0, 0, 0, NULL, '엄마와의 산책', 'gummy12'),
	(15, '2023-01-01 18:52:05.761772', '2023-01-01 18:52:05.761772', '망원 산책로 쪽으로 자주 산책 하는데 산책하다가 아이스크림 먹으면 왜이리 맛있죠???\r\n\r\n집에서 그냥 먹는 아이스크림과 산책하다가 먹는 아이스크림은 차이가 엄청 큰거 같아요~~ \r\n\r\n여러분들도 꼭 한번 산책 하다가 아이스크림 사서 드셔보세요~~ 진짜 맛있습니다!!! \r\n\r\n아 그리고 가족들과 함께라면 행복도 2배가 될거에요!!! 먹었던 아이스크림 사진 이에요! ㅎㅎ', 0, 0, 0, NULL, ' 산책하다가  아이스크림 먹으면 왜이리 맛있죠??', 'eeeeee'),
	(16, '2023-01-01 21:25:55.629854', '2023-01-01 21:25:55.629854', '너무너무 기엽죠  울강아지랑 산책하면 너무너무 행복합니다`~~ 그래서 이름을 행복이라고 지었어요\r\n\r\n울강아지 종류는 말티푸 에요~~ 말티즈와 푸들이 합쳐진 종이죠 아주아주 귀엽답니당~~ 울강아지가 예전에 \r\n\r\n산책나가면 사람들이 다 쳐다 봤어요 너무 귀엽다고 사진도 찍고 하더라구요 갑자기 산책 하다가 울강아지 자랑을 하고 싶어져서\r\n\r\n여기서 이렇게 글을 쓰네요 ㅋㅋㅋ 제글 봐주셔서 감사합니다 울강아지 사진 한개 투척 할께요!!', 0, 0, 0, NULL, '울강아지 이름은 행복이 에요~~', 'doog124'),
	(17, '2023-01-01 21:32:35.871161', '2023-01-01 21:32:35.871161', '정말 세상일은 모르는 건가봐요 정말 조용하고 착하고 배려심이 많던 친구였거든요\r\n\r\n그래서 가끔씩 생각이 날떄마다 궁금했었는데 이번에 같이 아는 친구랑 산책하면서 이야기하다가\r\n\r\n들었는데 마라토너가 됬다고 하더라구요~~ 많이 놀랐어요!! 활동적이지 않던 친구라 마라토너가 될줄은ㅋㅋㅋ 친구야 멋있따!\r\n성공해랏!!', 0, 0, 0, NULL, '이번주에 제친구랑 산책하다가 소식이 없던 친구의 소식을 들었는데요', 'dddddd'),
	(18, '2023-01-01 21:41:00.000215', '2023-01-01 21:41:00.000215', '저는 자주 계천에 나가서 산책을 자주 하는데요 제가 좋아하던 초등학교 6 학년떄 \r\n담임 선생님을 만났어요 제가 엄청 따르던 좋으신 분이셨거든요 항상 제자들을 잘 \r\n생각해주시고 따뜻한 마음으로 우리 학생들을 가르쳐 주시던\r\n아주 착하시고 인자하신 분이셨는데 세월이 야속하게도 주름이 많이 \r\n가셨더라구요~  그런모습 뵈니까 뭔가 가슴이 뭉클하면서 \r\n옛날일도 떠오르던 그런 측은한 하루였어요~ ', 0, 0, 0, NULL, '산책하다 담임선생님 만난썰', 'cccccc'),
	(19, '2023-01-01 21:54:12.878596', '2023-01-01 21:54:12.878596', '항상 저녁밥먹고 제 남동생이랑 같이 산책을 가거든용~~ 근데 동생은 한강부근 산책을좋아하고 저는 그냥 집주변\r\n\r\n놀이터를 산책하는걸 좋아해요 그래서 사이좋게 한번은 동생이 가고싶은 한강부근 산책을 또한번은 제가 좋아하는\r\n\r\n집주변 산책을 하는 중이랍니당~~ 여러분들은 동생이랑 산책할떄 어디쪽으로 주로 가시나요?? 궁금하네요!!!', 0, 0, 0, NULL, '안녕하세요 저랑 제동생이랑 항상 저녁밥먹고', 'book1024'),
	(20, '2023-01-01 21:57:02.836917', '2023-01-01 21:57:02.836917', '제 친한 죽마고우 친구가 구미에서 회사생활을 하고있거든요 그친구가 구미에서 회사생활 하지않고 \r\n\r\n서울에 있을 떄는 항상 같이 산책을 했었는데 그친구가 구미에서도 꾸준히 산책을 하고 있나봐요~~ 근데 꼭 한번 구미와서\r\n\r\n산책 해보라고 공기가 진짜 끝내준다고 하더라구요 구미에 사시는 분들 정말 구미에서 산책하면 공기가 끝내주나요??\r\n\r\n궁금하네욧!!^^*', 0, 0, 0, NULL, ' 제 친구가 구미에서 회사생활 하고 있는데요~~', 'bbbbbb'),
	(21, '2023-01-01 22:02:43.696676', '2023-01-01 22:02:43.696676', '진짜 천상계 맛인거  모르시는거 아니죠?? 정말 엄청 맛있습니다\r\n\r\n이추운날에 그따뜻한 팥붕어빵 한입 먹으면 입김이 모락모락 나면서 \r\n\r\n정말 즐거움의 경지를 맛보실수 있으실 꺼에요 저의 말을 한번 믿어보시고 \r\n\r\n산책하다가 붕어빵가게가 보인다면 꼭한번 사먹어 보세요 정말 후회 없으실 거에요!!', 0, 0, 0, NULL, '산책하면서 붕어빵 집에 들러서 사먹으면', 'balloonPM');
