INSERT INTO `qna_board` (`qbno`, `moddate`, `regdate`, `content`, `hits`, `title`, `member_id`) VALUES
	(3, '2023-01-02 13:44:33.335851', '2023-01-02 13:44:33.335851', '지도에 핀 추가하고 싶은데 어떻게 하나요?', 1, '지도에 핀 추가', 'bbbbbb'),
	(4, '2023-01-02 13:45:25.104963', '2023-01-02 13:45:25.104963', '지도에 산책로만 나오는데 \r\n\r\n산책로 근처 맛집이나 카페 정보도 추가해주실 수 있나요?', 2, '건의사항 있습니다!', 'cccccc'),
	(5, '2023-01-02 13:47:13.472126', '2023-01-02 13:47:13.472126', '마이페이지에 프로필 사진 추가 못 하나요?', 2, '프로필 사진', 'cccccc'),
	(6, '2023-01-02 14:36:26.617344', '2023-01-02 14:36:26.617344', '실시간 채팅 만들어서 유저들끼리 소통할 수 있으면 좋을 것 같아요', 2, '건의사항 있습니다~', 'ffffff'),
	(7, '2023-01-02 17:02:11.337618', '2023-01-02 17:02:11.337618', '사진 크게 볼 수 있게 해주세요', 2, '사진 잘 안보여요', 'aaaaaa');
INSERT INTO `qna_board_reply` (`qbrno`, `moddate`, `regdate`, `content`, `id`, `nickname`, `qna_board_qbno`) VALUES
	(2, '2023-01-02 14:39:37.019280', '2023-01-02 14:39:37.019280', '지도 핀의 경우 담당자만 추가할 수 있습니다. 추천 게시판에 게시 후 상위 게시판에 오르면 담당자가 실사 후 핀 추가해드리고 있습니다. 감사합니다.', 'balloonPM', '풍선왕', 3),
	(3, '2023-01-02 14:41:49.593565', '2023-01-02 14:41:49.593565', '좋은 의견 감사합니다. 담당자에게 내용 전달하고 업데이트 추진하도록 하겠습니다.', 'balloonPM', '풍선왕', 4),
	(4, '2023-01-02 14:42:33.950929', '2023-01-02 14:42:33.950929', '현재까진 프로필 사진 기능이 구현되지 않은 상태입니다. 추후 구현할 예정이니 조금만 기다려주시면 감사하겠습니다.', 'balloonPM', '풍선왕', 5),
	(5, '2023-01-02 14:43:10.630906', '2023-01-02 14:43:10.630906', '좋은 의견 감사합니다. 담당자에게 전달하겠습니다.', 'balloonPM', '풍선왕', 6),
	(7, '2023-01-03 11:31:17.549285', '2023-01-03 11:31:17.549285', '좋은 의견 감사합니다. 개발팀에 의견 전달하겠습니다.', 'balloonPM', '풍선왕', 7);
INSERT INTO `recom_board` (`bno`, `moddate`, `regdate`, `content`, `good`, `hate`, `hits`, `subject`, `title`, `member_id`) VALUES
	(1, '2022-12-30 17:24:14.921836', '2022-12-30 14:43:38.196269', '안녕하세요 부천칼잡이 황재형입니다.\r\n\r\n제가 추천할 곳은 부천송내공원입니다\r\n\r\n제가 어릴때부터 여기 지나가면서 길빵하던곳이거든요\r\n\r\n추천올라서 등록하게되면\r\n\r\n연초에서 아이코스로 전향하겠습니다.', 0, 0, 2, '도보', '제 나와바리 추천합니다', 'ajajhstar'),
	(2, '2022-12-30 17:23:09.637926', '2022-12-30 14:56:35.485227', '안녕하세요 진도준(송중기)입니다.\r\n\r\n맹산공원 추천합니다.\r\n\r\n진양철씨가 저한테 사줬던 땅인데\r\n\r\n진양철씨가 와 그라믄 내가 니한테 순향 물려줄끼라 생각했나 라고\r\n\r\n말했을 때 마음이 싱숭생숭해서 찾아가봤던 공원입니다.\r\n\r\n심신미약상태를 회복하기에 적절하더군요', 0, 0, 3, '도보', '분당 내꺼였는데', 'eeeeee'),
	(3, '2022-12-30 15:03:36.275428', '2022-12-30 15:03:36.275428', '스틔분 좝솨입니다\r\n\r\n제가 한쿸에 놀뤄 가쓸때 travel 했던 load다\r\n\r\n여기스ㅓ 띵킹했습니다 여기 내가 살까?\r\n\r\n나중에 유명한 관광지 하게 되묜 그때 살거야 마니마니 가라', 0, 0, 2, '도보', '한쿸땅 좋아요', 'applegirl'),
	(4, '2022-12-30 15:30:38.047393', '2022-12-30 15:13:01.846887', '허허 안녕하세요 일론머스크입니다.\r\n\r\n제가 로켓 쏴서 돈 많이 벌었을 때 \r\n\r\n쇼핑하러 한국 갔었습니다 근데 강남둘레길이 참 좋더군요\r\n\r\n여기서 숨 크게 들이마실 때 화성으로 승천할뻔했는데 아쉽네요\r\n\r\n참고로 저의 추천코스는 강남둘레길 3코스입니다~', 0, 0, 2, '도보', '나의 추천 후회하지않아', 'dddddd'),
	(5, '2022-12-30 17:14:19.192516', '2022-12-30 15:23:45.785110', '안녕하세요 저 김태성입니다.\r\n\r\n다들 아메리카노 좋아하세요?? 저는 좋아합니다\r\n\r\n제가 당산공원에서 자전거타면서 코딩해봤는데 머리가 맑아져서 그런지\r\n\r\n술술 쓰게 되더라구요 여기서 아메리카노 한잔 딱 들이켜주면 크~ \r\n\r\n자빠집니다', 0, 0, 3, '자전거', '공기좋고 커피맛 좋은 당산공원', 'kimtaesung1004'),
	(6, '2022-12-30 17:25:19.563640', '2022-12-30 15:41:15.835775', '안녕하세요 흥부라고 합니다.\r\n\r\n제가 추천하는 곳은 삼막애견공원입니다.\r\n\r\n여기로 강쥐랑 함께 산책하러 오시는 분들이 꽤 되더라구요\r\n\r\n저희 애는 너무 겁이 많아가지고 자꾸 도망치려해서 목줄 잡느라 힘들었네요ㅎㅎ^^\r\n\r\n거기 견주님들도 너무 착하셔서 저희 애가 겁먹은게 불쌍했는지 강쥐들 통제를 너무 잘해주셔서 감사했어요\r\n\r\n놀러갔을 때 저희 애 사진 하나 같이 첨부합니다~', 0, 0, 3, '애견', '애완동물과 함께 산책 한바퀴', 'bbbbbb'),
	(7, '2022-12-30 16:00:00.060975', '2022-12-30 16:00:00.060975', '내가 마장동에서 칼빵맞고 청계천에 빠졌을 때 \r\n\r\n어떻게든 물속에서 살아남았다...\r\n\r\n그리고 지나가던 사람의 자전거를 탈취해서 도주하는데\r\n\r\n기분이 그렇게 좋더군 칼빵맞기 좋은 날이다 라고 생각할 정도로...', 0, 0, 1, '자전거', '자전거가 건강에 좋아', 'aaaaaa'),
	(8, '2022-12-30 16:20:58.774540', '2022-12-30 16:20:58.774540', '안녕하세요 펭귄을 키우고 있는 놀부입니다.\r\n\r\n여기 광주에 펭귄마을이라는곳이 있는데\r\n\r\n볼거리도 아주 많고 펭귄모형도 많다보니 저희 애가 친구인줄 알고\r\n\r\n너무 좋아하더라고요.\r\n\r\n다들 집에서 펭귄 한마리씩은 키우시잖아요~ 같이 놀러가시면 좋을 것 같습니다~', 0, 0, 2, '애견', '펭귄마을 둘레 한번 돌아보면 다릅니다', 'cccccc'),
	(9, '2022-12-30 16:27:37.693410', '2022-12-30 16:27:37.693410', '안녕하세요 모두가 아시는 조인성입니다.\r\n\r\n제가 논산훈련소에서 힘들 때마다 몰래 탈영해서 탑정호수공원에서\r\n\r\n산책하다 들어가곤 했는데 이번에 풍선을 알게되어서 추천해보려고합니다\r\n\r\n만약 1등을해서 탑정호수공원이 등록하게되면 추첨을 통해\r\n\r\n저와함께 산책 할 수 있는 영광을 드리겠습니다.', 0, 0, 1, '도보', '조인성과 함께하는 산책 이벤트', 'iamactor'),
	(10, '2022-12-30 16:59:09.793259', '2022-12-30 16:59:09.793259', '제가 사실 껌 중독자입니다.\r\n\r\n제가 잠이 많아서 코딩할때 맨날 잠을 깨기위해 졸음껌을 씹어왔는데 중독되더군요\r\n\r\n울릉도로 놀러왔다가 여기서도 껌을 씹어야하나 기분이 좋지않았는데\r\n\r\n행남에서 산책하다보니 껌씹기 좋은 곳이다 라고 느꼈습니다.', 0, 0, 3, '도보', '행남 해안산책로 추천합니다~', 'gummy12'),
	(11, '2022-12-30 17:12:21.105793', '2022-12-30 17:12:21.105793', '안녕하세요 TIS교육센터 팀장입니다.\r\n\r\n요새 4강의실 교육기간이 끝나가다 보니\r\n\r\n교육생들의 출결이 막장입니다.\r\n\r\n한번은 너무 스트레스 받아서 좀 걸으려고 무작정 걷다보니\r\n\r\n육교가 나오더군요 바람이 기분좋게 불어서\r\n\r\n잘 얘기해 보려고 합니다. 파이팅', 0, 0, 3, '도보', '당산동 육교 산책로 추천합니다.', 'tis0901');
